import logo from './logo.svg';
import './App.css';
import { BrowserRouter } from 'react-router-dom';
import Sidebar from "./components/Sidebar";
import AppRoutes from './routes/AppRoutes';
function App() {
  return (
      <>
      <BrowserRouter>
        <Sidebar />
        <AppRoutes />
      </BrowserRouter>
        </>
  );
}

export default App;
